// AgentsPage.js
import React from 'react';

function AgentsPage() {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>발로란트 요원 목록</h1>
      <ul style={styles.list}>
        <li>제트</li>
        <li>세이지</li>
        <li>피닉스</li>
        <li>소바</li>
        <li>브림스톤</li>
        {/* 더 추가 가능 */}
      </ul>
    </div>
  );
}

const styles = {
  container: {
    padding: '60px',
    backgroundColor: '#f5f5f5',
    color: '#333',
    minHeight: '100vh',
  },
  title: {
    fontSize: '36px',
    marginBottom: '30px',
  },
  list: {
    fontSize: '20px',
    listStyle: 'none',
    padding: 0,
  },
};

export default AgentsPage;
